void compute_shortest_path(int start_x, int start_y, int goal_x, int goal_y) {
	//compute 1-d index of start and goal given xy coord
	int source = start_x + (MAP_WIDTH*start_y);
	int destination = goal_x + (MAP_WIDTH*goal_y);
	static bool init = false;
	if (init == false) {
		//init g pointer
		//printf("%d\n", sizeof(graph_t));
		g = calloc(1, sizeof(heap_t));
		//init graph
		generate_grid(g);
		init = true;
	}
	//compute dijkstras
	dijkstra(g, source, destination);
	//compute path
	print_path(g, destination);
	//print_ptg for debugging purposes.
	//print_ptg();
	//visualise the map for debugging purposes.
	map_visualiser();

}

void generate_undirected_edge(graph_t *g, int source, int destination, int weight) {
	add_edge(g, source, destination, weight);
	add_edge(g, destination, source, weight);
}

void add_vertex(graph_t *g, int i) {
	if (g->vertices_size < i + 1) {
		int size = g->vertices_size * 2 > i ? g->vertices_size * 2 : i + 4;
		g->vertices = realloc(g->vertices, size * sizeof(vertex_t *));
		for (int j = g->vertices_size; j < size; j++)
			g->vertices[j] = NULL;
		g->vertices_size = size;
	}
	if (!g->vertices[i]) {
		g->vertices[i] = calloc(1, sizeof(vertex_t));
		g->vertices_len++;
	}
}

void add_edge(graph_t *g, int a, int b, int w) {
	add_vertex(g, a);
	add_vertex(g, b);
	vertex_t *v = g->vertices[a];
	if (v->edges_len >= v->edges_size) {
		v->edges_size = v->edges_size ? v->edges_size * 2 : 4;
		v->edges = realloc(v->edges, v->edges_size * sizeof(edge_t *));
	}
	edge_t *e = calloc(1, sizeof(edge_t));
	e->vertex = b;
	e->weight = w;
	v->edges[v->edges_len++] = e;
}

heap_t *create_heap(int n) {
	heap_t *h = calloc(1, sizeof(heap_t));
	h->data = calloc(n + 1, sizeof(int));
	h->prio = calloc(n + 1, sizeof(int));
	h->index = calloc(n, sizeof(int));
	return h;
}

void push_heap(heap_t *h, int v, int p) {
	int i = h->index[v] == 0 ? ++h->len : h->index[v];
	int j = i / 2;
	while (i > 1) {
		if (h->prio[j] < p)
			break;
		h->data[i] = h->data[j];
		h->prio[i] = h->prio[j];
		h->index[h->data[i]] = i;
		i = j;
		j = j / 2;
	}
	h->data[i] = v;
	h->prio[i] = p;
	h->index[v] = i;
}

int minimum(heap_t *h, int i, int j, int k) {
	int m = i;
	if (j <= h->len && h->prio[j] < h->prio[m])
		m = j;
	if (k <= h->len && h->prio[k] < h->prio[m])
		m = k;
	return m;
}

int pop_heap(heap_t *h) {
	int v = h->data[1];
	int i = 1;
	while (1) {
		int j = minimum(h, h->len, 2 * i, 2 * i + 1);
		if (j == h->len)
			break;
		h->data[i] = h->data[j];
		h->prio[i] = h->prio[j];
		h->index[h->data[i]] = i;
		i = j;
	}
	h->data[i] = h->data[h->len];
	h->prio[i] = h->prio[h->len];
	h->index[h->data[i]] = i;
	h->len--;
	return v;
}

void dijkstra(graph_t *g, int a, int b) {
	int i, j;
	for (i = 0; i < g->vertices_len; i++) {
		vertex_t *v = g->vertices[i];
		v->dist = INT_MAX;
		v->prev = 0;
		v->visited = 0;
	}
	vertex_t *v = g->vertices[a];
	v->dist = 0;
	heap_t *h = create_heap(g->vertices_len);
	push_heap(h, a, v->dist);
	while (h->len) {
		i = pop_heap(h);
		if (i == b)
			break;
		v = g->vertices[i];
		v->visited = 1;
		for (j = 0; j < v->edges_len; j++) {
			edge_t *e = v->edges[j];
			vertex_t *u = g->vertices[e->vertex];
			if (!u->visited && v->dist + e->weight <= u->dist) {
				u->prev = i;
				u->dist = v->dist + e->weight;
				push_heap(h, e->vertex, u->dist);
			}
		}
	}
}

void print_path(graph_t *g, int i) {
	int n, j;
	vertex_t *v, *u;

	v = g->vertices[i];
	if (v->dist == INT_MAX) {
		printf("no path\n");
		return;
	}
	//n refers to the no. of vertices in the path
	//u->dist refers to the total cost of the path
	//the path array stores the path information. first element is the source vertex. last element is the destination vertex.
	for (n = 1, u = v; u->dist; u = g->vertices[u->prev], n++);
	int *path = malloc(n);
	path[n-1] = i;
	//this line populates the path array with path info
	for (j = 0, u = v; u->dist; u = g->vertices[u->prev], j++) {
		path[n - j - 2] = u->prev;
	}
	//this line, the path array has been populated.
	for (int i = 0; i < n; i++) {
		path_to_goal[i] = path[i];
	}
	path_length = n;
}
